import { createRouter, createWebHistory } from 'vue-router';

import HomeView from '../views/HomeView.vue';
import AntinaHome from '../views/AntinaHome.vue';

// Components Data
import PhoneCheckout from '../views/Checkout.vue';

const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeView
  },
  {
    path: '/ole-diario-usuarios-noticias-futbol-entretenimiento',
    name: 'user-data',
    component: AntinaHome
  },
  {
    path: '/ole-verificacion-diario-noticias-futbol-entretenimiento-socios-comunidad',
    name: 'check-phone',
    component: PhoneCheckout
  },
  // {
  //   path: '/contacto',
  //   name: 'contacto-form',
  //   component: Contacto
  // },
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
